import React from "react";

interface Props {
    one_liners: string[],
    expansions: string[],
    books: string[],
}

class Introduction extends React.PureComponent<Props>{

    // Remove the data-aos if not using AOS on App root.
    render() {
        const { one_liners, expansions, books } = this.props;
        var traits = [];
        var shelves = [];

        for (let i = 0; i < one_liners.length; i++) {
            traits.push(
                <p className="text_expanded">
                    <span className="expand_text">{one_liners[i]}</span> {expansions[i]}
                </p>
            );
        };
        for (let i = 0; i < books.length/5; i++) {
            let shelf = [];
            for(let j=0; j<5;)
            shelf.push(
                <div className="job">
                    <img src={book[i]} alt="jobImage1" />
                    <div className="job_description">
                        <h3>{titles[i]}</h3>
                        <p>{descriptors[i]}</p>
                    </div>
                </div>
            );
        };


        return (
            <section id="experience">
                <h1>public void Experience job(Time time){'{'}</h1>
                <div id="jobs">
                    {experiences}
                </div>
                <h1>{"}"}</h1>
            </section>
        );
    }
}

